import React from "react";
import './SignUp.css'
import login_keys from "../../images/login_keys-removebg.png";
import {useForm} from "react-hook-form";
import {Link} from "react-router-dom";

export default function SignUp() {
    return (
        <div className={'signup'}>
            <div className={'signup-header'}>
                Virtual closet
            </div>
            <img
                className="login-keys"
                src={login_keys}
            >
            </img>
            <SignUpBlock/>
        </div>
    )
}

function SignUpBlock(props) {
    const {
        register,
        handleSubmit,
        watch,
        formState: {errors}
    } = useForm();

    return (
        <div className='signup-block'>
            <div className="signup-block-login">
                <div className="signup-block-login-title">
                    Login:
                </div>
                <div className='signup-block-login-form'>
                    <input
                        className="signup-block-login-form-input"
                        defaultValue="test"
                        {...register("example")} />
                </div>
            </div>
            <div className="login-block-login">
                <div className="login-block-login-title">
                    Password:
                </div>
                <div className='login-block-login-form'>
                    <input
                        className="login-block-login-form-input"
                        defaultValue="test"
                        {...register("example")} />
                </div>
            </div>

        </div>
    );
}
